import React from 'react';
import { useLocation } from 'react-router-dom';

function Historico() {
  const { state } = useLocation();
  const { responses } = state;

  return (
    <div className="bg-white p-4 min-h-screen">
      <h1 className="text-2xl font-bold text-center mb-4">Hist√≥rico de Respostas</h1>
      <div className="flex flex-col items-center justify-center">
        {responses.map((response, index) => (
          <div key={index} className="bg-gray-100 p-4 rounded-lg shadow-md m-2 w-full max-w-4xl">
            <h2 className="font-semibold">{response.question}</h2>
            <p className="text-gray-700">{response.answer}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Historico;
